import React from 'react';
import './style.css'; // Add your styling

const Dashboard = () => {
  return (
    <div className="dashboard">
      <img src="/assets/logonew.jpg" alt="Logo" className="logo" />
      <h1>Welcome to MEMES254KE</h1>
      <p>Bringing you the best memes daily!</p>
      <div className="social-links">
        <a href="https://facebook.com/yourpage">Facebook</a>
        <a href="https://instagram.com/yourpage">Instagram</a>
        <a href="https://twitter.com/yourpage">Twitter</a>
      </div>
      <nav>
        <a href="/meme-generator">Meme Generator</a>
        <a href="/chat">Chat with Us</a>
      </nav>
    </div>
  );
};

export default Dashboard;
